import React from 'react'
import { useState } from 'react'
import img from "../Images/Surplus1.jpg"
import { useNavigate } from 'react-router-dom'
import "./Admin.css"
export default function Admin() {
    const [username,setusername]= useState('');
    const [password,setpassword]= useState('');
    let stats = false;
    const navigate = useNavigate();
    const formhandler=(event)=>{
        event.preventDefault();
        
        if(password==='1234'){
            navigate('/admindisplay');
        }
        else{
            alert("Invalid Admin Password");
            setpassword('');
            setusername('');
        }
        
        
    }
    const passwordsetter = (event)=>{
        setpassword(event.target.value);
    };
    const usernamesetter = (event)=>{
        setusername(event.target.value);
    };
  return (
    <div className="container">
        <div className="login-form">
            <h2>Login</h2>
            <form onSubmit={formhandler}>
                <div className="form-group">
                    <label for="username">Username:</label>
                    <input type="text" id="username" name="username" required onChange={usernamesetter} value={username}/>
                </div>
                <div className="form-group">
                    <label for="password">Password:</label>
                    <input type="password" id="password" name="password" required onChange={passwordsetter}/>
                </div>
                <button className='btadmin' type="submit">Login</button>
            </form>
        </div>
        <div classN="image-container">
            <img src={img} alt="Image Placeholder" className='imageadmin'/>
        </div>
    </div>
  )
}
